import React from "react";
import { useState, useEffect } from "react";
// import SmallerCards from "../SmallerCards";
// import { getAPIData } from "./getAPIData";
import Breadcrumbs from '@mui/material/Breadcrumbs';
import Link from '@mui/material/Link';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';
import SaveAltIcon from '@mui/icons-material/SaveAlt';
import FacebookIcon from '@mui/icons-material/Facebook';
import TwitterIcon from '@mui/icons-material/Twitter';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import CardActions from '@mui/material/CardActions';
import Grid from '@mui/material/Grid';
import { CardActionArea } from '@mui/material';
import MoreHorizIcon from '@mui/icons-material/MoreHoriz';
import Button from '@mui/material/Button';
import StarIcon from '@mui/icons-material/Star';
import Chip from '@mui/material/Chip';

const EducationRankingList = () => {
  const [articles, setArticles] = useState([]);

  useEffect(() => {
    // getAPIData("business").then((data) => {
    //   console.log(data);
    //   setArticles(data.articles);
    // });
  }, []);

  console.log(articles);

  return (
    <div>
         <Breadcrumbs aria-label="breadcrumb">
        <Link underline="hover" color="inherit" href="/">
          Home
        </Link>
        {/* <Link
          underline="hover"
          color="inherit"
          href="/getting-started/installation/"
        >
          Core
        </Link> */}
        <Typography color="text.primary">Education</Typography>
      </Breadcrumbs>
      <br />
   <h1 style={{fontWeight:'800'}}>Best National University Rankings</h1>
   {/* <br></br> */}
   <p>2021 Rankings</p>
   <p>Schools in the National Universities category, such as the University of Chicago and Carnegie Mellon University, offer a full range of undergraduate majors, plus master's and doctoral programs. These colleges also are committed to producing groundbreaking research</p>
   {/* <Divider orientation="vertical"flexItem />   */}

<span style={{ display: "flex",
  justifyContent: "spaceBetween",
  width: "20%"}}> 

<span style={{ display: "flex",
  justifyContent: "spaceBetween",
  width: "15%"}}><FacebookIcon style={{color:'blue'}}/></span>
<span style={{ display: "flex",
  justifyContent: "spaceBetween",
  width: "15%"}}><TwitterIcon style={{color:'lightblue'}}/></span>
  <span style={{ display: "flex",
  justifyContent: "spaceBetween",
  width: "15%"}}><MoreHorizIcon/></span>
</span> 

<br></br>
{/* <span style={{ display: "flex",
  justifyContent: "spaceBetween",
  width: "85%"}}>

   <span style={{ display: "flex",
  justifyContent: "spaceBetween",
  width: "95%"}}> <Button style={{borderRadius:'25px'}} variant="outlined">National Liberal Arts Collage</Button></span>
   <span style={{ display: "flex",
  justifyContent: "spaceBetween",
  width: "80%"}}> <Button style={{borderRadius:'25px'}}variant="outlined">Buisness program</Button></span>
   <span style={{ display: "flex",
  justifyContent: "spaceBetween",
  width: "80%"}}> <Button style={{borderRadius:'25px'}}variant="outlined">Engineering(Doctorial Offered)</Button></span>
   <span style={{ display: "flex",
  justifyContent: "spaceBetween",
  width: "80%"}}> <Button style={{borderRadius:'25px'}}variant="outlined">Top Public School</Button></span>
   <span style={{ display: "flex",
  justifyContent: "spaceBetween",
  width: "80%"}}> <Button style={{borderRadius:'25px'}} variant="outlined">Undergraduate Teaching</Button></span>

</span> */}
<span style={{ display: "flex",
  justifyContent: "spaceBetween",
  width: "45%"}}>

   <span style={{ display: "flex",
  justifyContent: "spaceBetween",
  width: "42%"}}> <Button style={{borderRadius:'25px'}} variant="outlined">Ranking</Button></span>
   <span style={{ display: "flex",
  justifyContent: "spaceBetween",
  width: "45%"}}> <Button style={{borderRadius:'25px'}}variant="outlined">Economy</Button></span>
   <span style={{ display: "flex",
  justifyContent: "spaceBetween",
  width: "53%"}}> <Button style={{borderRadius:'25px'}}variant="outlined">Geography</Button></span>
   <span style={{ display: "flex",
  justifyContent: "spaceBetween",
  width: "53%"}}> <Button style={{borderRadius:'25px'}}variant="outlined">Population</Button></span>
   <span style={{ display: "flex",
  justifyContent: "spaceBetween",
  width: "45%"}}> <Button style={{borderRadius:'25px'}} variant="outlined">Sort</Button></span>

</span>
<br></br>
<Divider  flexItem />  
<br></br>
{/* <p>78 Countries</p> */}
<Grid container spacing={3}>







<Grid item xs={12} md={8}>
      <CardActionArea component="a" href="#">
        <Card sx={{ display: 'flex',minWidth: 100 }}>
        <CardMedia
            component="img"
            sx={{ width: 200, display: { xs: 'none', sm: 'block' } }}
            image="data:image/jpeg;base64,"
            alt=""
          />
          <CardContent sx={{ flex: 1 }}>
            <Typography component="h2" variant="h5">
